    true,nt"url": null,nt"notes": "<p>The Nanomaterial Registry compiles data
    from multiple databases into a single resource.  The goal of this resource is to
    establish a curated nanomaterial registry, whose primary function is to provide
    consistent information on the biological and environmental interactions of well-characterized
    nanomaterials, as well as links to associated publications, modeling tools, computational
    results and manufacturing guidances. The publicly available Registry is intended
    to serve as a comprehensive resource for the nanomaterial community, providing data
    that has been systematically curated based on minimal information standards built
    with broad community acceptance. It provides a way to tie together different sources
    of information for a specific nanomaterial and allows users to search and compare
    characteristic data on different nanomaterials.</p>n<p>The registry provides tools
    for analyzing and comparing data on the biological and environmental implications
    of well-characterized nanomaterials. This resource will evolve as the quality and
    quantity of the information on nanomaterials improve. Hundreds of nanomaterial entries
    have been curated into the registry for physico-chemical characteristics and are
    available to the public. Biological and environmental study data for existing nanomaterial
    entries will also be curated into the registry.</p>n<p>The nanomaterial registry
    provides the following functions for the research community: basic and advance search
    through key words or physical and chemical characteristics (PCC); ability to browse
    nanomaterials based on categories; detailed information about PCC and the biological,
    and environmental interactions of nanomaterials; display the quality of the characterization
    of each nanomaterial entry in the form of compliance level that is algorithm based;
    compare PCC and the biological and environmental interactions of nanomaterials;
    and find similar nanomaterials based on PCC and the biological and environmental
    interactions of nanomaterials.</p>n",nt"license_title": "Other License Specified",nt"extras":
